        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'We''ve had no luck reaching anyone up in Calcenon. '
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - Even Victoria never got back to me after leaving.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - Is everything okay?
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - "..."
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - I see...
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - So it's just like Devon. And that was just a prototype?
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - I'd say I can hardly believe it, but unfortunately, I can.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - The others-- are they well?
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - "..."
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - Just Saphira, then.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'As expected from the highest ranking Leader and our '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - Champion-to-be.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'I cannot approve of going along with Meteor''s game, '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - 'but I know that my comments are far too little and far '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - too late.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'I''ll make preparations to head there myself and see if I '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - can do anything to help those affected.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'But first, you will be needing advice for Saphira, '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - won't you?
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - Of course-- One second, please.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - That would have been Monty's Gym, wouldn't it...
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - Yes, here it is.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'The most threatening feature of the gym is '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - its boost to Dragon Type attacks.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'Because they, and other moves like Dragon Dance, '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - 'double in power, Saphira is free to invest heavily in '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - Speed.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'These boosts are available to you as well, and if you '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - 'can make use of them, battles in this gym may '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - become one-sided for either party.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'Alternatively, a bulky Fairy Type may force her to set '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - 'up and open a window in which to punish her '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - offensive.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'Not that I''m trying to advertise or anything... '
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'However, none of these will help when it comes to '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - her ace, Dragonite.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'It''s Multiscale ability will negate its Dragon Type '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - weakness regardless of its health,
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - And the heat of this field will soften Ice Type attacks.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'Therefore, Rock Type is your only viable choice to hit '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - Dragonite effectively.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'Try to save such an attacker for it to reduce its '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - chances to sweep.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - If anyone can win this, it's you.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'This is your final hurdle before properly claiming your '
